.alignfull & .alignwide without a container
main { 
    > [class*="wp-block-"]:not(.alignwide,.alignfull),
    > :not(h1,h2,h3,h4,h5,h6,p,li):not(.alignwide,.alignfull) {
        /**
        *  Set a max-width, margin & padding here
        *  which conforms to your desired measure.
        *
        *  This takes the place of a container/wrapper element.
        **/
    }

    > [class*="wp-block-"].alignwide {
        /**
        *  Allow for wideset elements to be wider
        *  than our generic measure. Set a small amount of 
        *  horizontal padding so that content doesn't bump
        *  against viewport at lower resolutions.
        **/
    }

    > [class*="wp-block-"].alignfull {
        /**
         * Set max-width to be 100%. Text elements may still require 
         * padding to prevent the above viewport issue. This can be 
         * set on those elements directly.
         **/
    }
}

TAILWIND/ALIGN.html.body:
_align.scss
main.main > [class*="wp-block-"]:not(.alignwide,.alignfull),
main.main > :not(h1,h2,h3,h4,h5,h6,p,li):not(.alignwide,.alignfull) {
  @apply max-w-lg mx-auto px-8 py-8;
}

main.main > [class*="wp-block-"]:not(.alignwide,.alignfull),
main.main > :not(.alignwide,.alignfull) {
  @extend .container;
}

main.main > [class*="wp-block-"].alignwide {
  @apply max-w-xl mx-auto my-10;
}

main.main > [class*="wp-block-"].alignfull {
  @apply max-w-full mx-0 my-12 py-12;
}

main.main > [class*="wp-block-"].alignleft > * {
  @apply float-left mr-4;
}

main.main > [class*="wp-block-"].alignright > * {
  @apply float-right ml-4;
}

main.main > [class*="wp-block-"]:not(.wp-block-cover).alignleft,
main.main > [class*="wp-block-"]:not(.wp-block-cover).alignright,
main.main > [class*="wp-block-"]:not(.wp-block-cover).aligncenter {
  @apply mx-auto pt-4;
}

main.main > .wp-block-cover.alignleft,
main.main > .wp-block-cover.alignright {
  ::after {
    content: "";
    display: table;
    clear: both;
  }
}

main.main > div.wp-block-cover.alignleft {
  @apply float-left mx-8 mr-8 my-8;
}

main.main > div.wp-block-cover.alignright {
  @apply float-right mx-8 ml-8 my-8;
}

TAILWIND/COPY.html.body:
_copy.scss
main.main {
  h1,
  h2,
  h3,
  h4,
  h5,
  h6,
  p,
  ul li,
  ol li,
  > span,
  > a,
  table * {
    @apply font-sans;
  }

  pre,
  .wp-block-code,
  .wp-block-verse,
  code {
    @apply font-mono overflow-hidden;
  }

  > h1,
  > h2,
  > h3,
  > h4,
  > h5,
  > h6 {
    @apply leading-tight;
  }

  > h1 {
    @apply pt-8 pb-4;
  }

  > h2,
  > h3 {
    @apply pt-4 pb-4;
  }

  > h4,
  > h5,
  > h6 {
    @apply my-0 pt-4 pb-0 uppercase;
  }

  > ul {
    @apply list-reset;
  }

  > ul,
  > ol {
    @apply my-0 ml-4 py-4;
  }

  > ul ul,
  > ol ol {
    @apply my-0 py-0;
  }

  > ul li,
  > ol li {
    @apply mt-4 mb-0 pb-0;
  }

  > p,
  > ul:not([class*="wp-block"]) li,
  > ol:not([class*="wp-block"]) li,
  > pre,
  > span,
  > table * {
    @apply text-base leading-normal;
  }

  p {
    @apply py-4;
  }

  /** axiomatic */
  p + p {
    @apply my-0 pt-0;
  }

  /** buttons */
  a:not(.wp-block-button__link) {
    @apply text-primary no-underline border-b border-transparent;

    transition: 0.2s ease;

    &:hover {
      @apply border-primary;
    }
  }

  pre {
    @apply w-full overflow-x-scroll my-4;
  }
}

TAILWIND/UNORDERED_GRIDS.html.body:
_unordered_grids.scss
main.main > ul:not(.wp-block-categories):not(.wp-block-archives) {
  li {
    @apply list-reset;
  }
}

main.main > ul:not([class*="columns-"]):not(.is-grid) {
  li::before,
  li ul li::before {
    content: "👉 ";
  }
}

TAILWIND/QUOTES.html.body:
_quotes.scss
main.main > blockquote.wp-block-quote,
main.main > blockquote.wp-block-quote.is-large,
main.main > blockquote.wp-block-quote.is-style-large {
  @apply my-4 mx-auto px-8 py-8;
}

main.main > figure.wp-block-pullquote {
  @apply mx-auto;
}

main.main > figure.wp-block-pullquote.alignfull {
  @apply px-4;
}

main.main > blockquote.wp-block-quote > cite,
main.main > figure.wp-block-pullquote > blockquote > cite {
  @apply
    inline-block pt-4
    font-sans uppercase roman font-semibold tracking-tight;

  &::before {
    content: "\2014 ";
  }
}

main.main > figure.wp-block-pullquote.alignleft,
main.main > figure.wp-block-pullquote.alignright {
  @apply pt-4 max-w-full;

  > blockquote {
    @apply max-w-xs mt-12 mb-4 mx-8;
  }
}

main.main > figure.wp-block-pullquote.alignleft {
  > blockquote {
    @apply ml-0;
  }
}

main.main > figure.wp-block-pullquote.alignright {
  > blockquote {
    @apply mr-0;
  }
}

main.main > figure.wp-block-pullquote[class*="align"] cite {
  @apply mt-4;
}
